pragma solidity 0.8.4;

import "@openzeppelin/contracts-upgradeable/proxy/utils/Initializable.sol";
import "../interfaces/IModuleMap.sol";

abstract contract ModuleMapConsumer is Initializable {
    IModuleMap public moduleMap;

    function __ModuleMapConsumer_init(address moduleMap_) internal onlyInitializing {
        moduleMap = IModuleMap(moduleMap_);
    }
}
","keccak256":"0x562431546443640c950a15ccce0cffedeced3e414c41cc2758bf489f4525d1df","license":"GPL-2.0"},"contracts/core/StrategyMap.sol":{"content":"// SPDX-License-Identifier: GPL-2.0
pragma solidity 0.8.4;

import "@openzeppelin/contracts-upgradeable/proxy/utils/Initializable.sol";

import "../interfaces/IStrategyMap.sol";
import "../interfaces/IStrategy1155.sol";
import "../interfaces/IUserPositions.sol";
import "../interfaces/IIntegration.sol";
import "../interfaces/IAMMIntegration.sol";
import "../interfaces/IIntegrationMap.sol";
import "../interfaces/ISyntheticERC20.sol";
import "../interfaces/ISyntheticMap.sol";
import "../interfaces/IERC20.sol";

import "./ModuleMapConsumer.sol";
import "./Controlled.sol";

contract StrategyMap is Initializable, ModuleMapConsumer, Controlled, IStrategyMap {
    uint32 public constant TOKEN_WEIGHT = 100000;

    // Strategy id => Strategy
    mapping(uint256 => Strategy) internal strategies;

    /// @dev |-***-| Deprecated after tokenization |-***-|
    /// @dev Use IStrategy1155.totalSupplyBatch() instead
    mapping(address => uint256) internal tokenBalances;

    // Strategy => token => balance
    mapping(uint256 => mapping(address => uint256)) internal strategyTokenBalances;

    /// @dev |-***-| Deprecated after tokenization |-***-|
    /// @dev use deployAmount instead
    mapping(address => mapping(uint32 => mapping(address => int256))) internal deployAmount_DEPRECATED;

    /// @dev |-***-| Deprecated after tokenization |-***-|
    /// @dev Users now are not able to close positions manually because they have synthetic pool for withdrawals
    mapping(address => ClosablePosition[]) private _closablePositions;

    uint256 public override idCounter;

    // Used for strategy verification. Contents are always deleted at the end of a tx to reduce gas hit.
    mapping(address => uint256) internal tokenWeights;

    // Integration => poolId => token => { deploy; hedge }
    mapping(address => mapping(uint32 => mapping(address => DeployAmount))) internal deployAmount;

    function initialize(address[] memory controllers_, address moduleMap_) external initializer {
        __Controlled_init(controllers_, moduleMap_);
    }

    /**
     *
     *
     * manager's functions
     *
     *
     **/

    function addStrategy(
        string calldata name,
        Integration[] calldata integrations,
        Token[] calldata tokens,
        uint256[] calldata maxCap
    ) external override onlyController {
        require(integrations.length > 0, "integrations missing");
        require(tokens.length > 0, "tokens missing");
        require(bytes(name).length > 0, "must have a name");
        require(tokens.length == maxCap.length, "caps are missing");

        idCounter++;
        uint256 strategyId = idCounter;

        _verifyAndSetStrategy(strategyId, name, integrations, tokens, maxCap);
        IStrategy1155(moduleMap.getModuleAddress(Modules.Strategy1155)).deployStrategyToken(
            name,
            strategyId,
            tokens[0].token
        );
        ISyntheticMap(moduleMap.getModuleAddress(Modules.SyntheticMap)).deploySyntheticTokenIfNotExist(tokens[0].token);

        // Emit event
        emit NewStrategy(strategyId, integrations, tokens, name);
    }

    function updateName(uint256 strategyId, string calldata name) external override onlyController {
        require(bytes(strategies[strategyId].name).length > 0, "strategy must exist");
        require(bytes(name).length > 0, "invalid name");
        strategies[strategyId].name = name;
        emit UpdateName(strategyId, name);
    }

    function addPairToStrategy(
        uint256 strategyId,
        Integration calldata integration,
        address token
    ) public override onlyManager {
        StrategySummary memory current = getStrategy(strategyId);
        int256 integrationIndex = -1;
        for (uint256 i; i < current.integrations.length; ++i) {
            if (current.integrations[i].integration == address(0)) {
                integrationIndex = int256(i);
                break;
            }
        }
        if (integrationIndex > -1) {
            strategies[strategyId].integrations[uint256(integrationIndex)] = integration;
        } else {
            strategies[strategyId].integrations.push(integration);
            integrationIndex = int256(current.integrations.length);
        }
        int256 tokenIndex = -1;
        for (uint256 i; i < current.tokens.length; ++i) {
            if (current.tokens[i].token == address(0)) {
                tokenIndex = int256(i);
                break;
            }
        }
        if (tokenIndex > -1) {
            strategies[strategyId].tokens[uint256(tokenIndex)] = Token({
                token: token,
                integrationPairIdx: uint256(integrationIndex),
                weight: 0
            });
        } else {
            strategies[strategyId].tokens.push(
                Token({token: token, integrationPairIdx: uint256(integrationIndex), weight: 0})
            );
        }
        emit AddIntegration(strategyId, integration, token);
    }

    function movePairWeight(
        uint256 strategyId,
        uint256 sourceIndex,
        uint256 destinationIndex,
        int256 vectorAmount,
        uint32 amount,
        bool rebalance
    ) external override onlyManager {
        require(strategies[strategyId].tokens[sourceIndex].weight >= amount, "invalid amount");
        strategies[strategyId].tokens[sourceIndex].weight -= amount;
        strategies[strategyId].tokens[destinationIndex].weight += amount;

        if (rebalance) {
            StrategySummary memory current = getStrategy(strategyId);

            // Decrease source deploy amount
            decreaseDeployAmount(
                current.integrations[current.tokens[sourceIndex].integrationPairIdx].integration,
                current.integrations[current.tokens[sourceIndex].integrationPairIdx].ammPoolID,
                current.tokens[sourceIndex].token,
                vectorAmount, // TODO: split amount to deploy and hedge
                0
            );

            // Increase dest deploy amount
            increaseDeployAmount(
                current.integrations[current.tokens[destinationIndex].integrationPairIdx].integration,
                current.integrations[current.tokens[destinationIndex].integrationPairIdx].ammPoolID,
                current.tokens[destinationIndex].token,
                vectorAmount, // TODO: split amount to deploy and hedge
                0
            );
        }
        emit IntegrationWeightAdjustment(strategyId, sourceIndex, destinationIndex, amount, rebalance);
    }

    function removePairFromStrategy(
        uint256 strategyId,
        uint256 integrationIndex,
        address token
    ) public override onlyManager {
        require(strategyId <= idCounter, "Bad strategy");

        StrategySummary memory current = getStrategy(strategyId);
        require(integrationIndex <= current.integrations.length, "bad integration");

        bool shouldRemoveIntegration = true;
        for (uint256 i; i < current.tokens.length; ++i) {
            if (current.tokens[i].integrationPairIdx == integrationIndex) {
                if (current.tokens[i].token == token) {
                    require(current.tokens[i].weight == 0, "weight > 0");
                    strategies[strategyId].tokens[i] = Token({token: address(0), integrationPairIdx: 0, weight: 0});
                } else {
                    shouldRemoveIntegration = false;
                }
            }
        }
        if (shouldRemoveIntegration) {
            strategies[strategyId].integrations[integrationIndex] = Integration({
                ammPoolID: 0,
                integration: address(0)
            });
        }
        emit RemoveIntegration(strategyId, integrationIndex, token);
    }

    function deleteStrategy(uint256 strategyId) external override onlyController {
        StrategySummary memory strategy = getStrategy(strategyId);
        for (uint256 i; i < strategy.tokens.length; ++i) {
            require(strategyTokenBalances[strategyId][strategy.tokens[i].token] == 0, "strategy in use");
            delete strategies[strategyId].availableTokens[strategy.tokens[i].token];
        }
        delete strategies[strategyId];
        emit DeleteStrategy(strategyId);
    }

    function setAvailableTokens(
        uint256 strategyId,
        address token,
        bool available
    ) external override onlyManager {
        strategies[strategyId].availableTokens[token] = available;
    }

    function setMaximumCap(
        uint256 strategyId,
        address token,
        uint256 maxCap
    ) external override onlyManager {
        require(token != address(0), "bad token");
        require(strategies[strategyId].tokens.length > 0, "invalid strategy");
        strategies[strategyId].maximumCap[token] = maxCap;
    }

    /**
     *
     *
     * strategy flow
     *
     *
     **/

    function increaseStrategy(
        uint256 _strategyId,
        address _token,
        uint256 _amount
    ) external override onlyController returns (uint256 strategyDebtClosed_) {
        Strategy storage strategy = strategies[_strategyId];

        require(strategy.availableTokens[_token], "invalid token");
        {
            uint256 maxCap = strategy.maximumCap[_token];
            if (maxCap > 0) {
                require(maxCap > (strategyTokenBalances[_strategyId][_token] + _amount), "at capacity");
            }
        }

        strategyTokenBalances[_strategyId][_token] += _amount;

        uint256 numberOfTokensInStrategy = strategy.tokens.length;
        for (uint256 j; j < numberOfTokensInStrategy; j++) {
            if (_token == strategy.tokens[j].token) {
                Integration storage integration = strategy.integrations[strategy.tokens[j].integrationPairIdx];

                (uint256 deployA, uint256 hedgeA) = _splitAmountToDeployAndHedgeAmounts(
                    _token,
                    (_amount * strategy.tokens[j].weight) / TOKEN_WEIGHT
                );

                (int256 currentDeploy, ) = getDeployAmount(integration.integration, integration.ammPoolID, _token);

                if (currentDeploy < 0) {
                    uint256 debt = uint256(-currentDeploy);
                    strategyDebtClosed_ += debt > deployA ? deployA : debt;
                }

                increaseDeployAmount(integration.integration, integration.ammPoolID, _token, deployA, hedgeA);
            }
        }
    }

    function _splitAmountToDeployAndHedgeAmounts(address _underlying, uint256 _amount)
        private
        view
        returns (uint256 deploy_, uint256 hedge_)
    {
        address syntheticERC20 = ISyntheticMap(moduleMap.getModuleAddress(Modules.SyntheticMap)).underlyingToSynthetic(
            _underlying
        );
        (uint256 n, uint256 d) = ISyntheticERC20(syntheticERC20).getHedgePercent();

        hedge_ = (_amount * n) / d;
        deploy_ = _amount - hedge_;
    }

    function decreaseStrategy(uint256 strategyId, uint256 amount) external override onlyController {
        Strategy storage strategy = strategies[strategyId];
        Token[] memory tokens = strategy.tokens;

        require(amount <= strategyTokenBalances[strategyId][tokens[0].token], "amount > strategy balance");

        uint256 tokenLength = tokens.length;

        strategyTokenBalances[strategyId][tokens[0].token] -= amount;

        for (uint256 j; j < tokenLength; j++) {
            Integration storage integration = strategy.integrations[tokens[j].integrationPairIdx];

            (uint256 deployA, ) = _splitAmountToDeployAndHedgeAmounts(
                tokens[j].token,
                (amount * strategy.tokens[j].weight) / TOKEN_WEIGHT
            );

            decreaseDeployAmount(integration.integration, integration.ammPoolID, tokens[j].token, deployA, 0);
        }
    }

    /**
     *
     *
     * deploy flow
     *
     *
     **/

    function decreaseDeployAmountChange(
        address _integration,
        uint32 _poolID,
        address _token,
        uint256 _deployAmount,
        uint256 _hedgeAmount
    ) public override onlyController {
        (int256 currentAmount, ) = getDeployAmount(_integration, _poolID, _token);
        if (currentAmount >= 0) {
            decreaseDeployAmount(_integration, _poolID, _token, _deployAmount, _hedgeAmount);
        } else {
            increaseDeployAmount(_integration, _poolID, _token, _deployAmount, _hedgeAmount);
        }
    }

    function updateDeployAmount(
        address integration,
        uint32 poolID,
        address token,
        uint256 amount,
        bool add
    ) external onlyManager {
        require(amount <= uint256(type(int256).max), "amount too large");
        require(
            IIntegrationMap(moduleMap.getModuleAddress(Modules.IntegrationMap)).getIsIntegrationAdded(integration),
            "Integration not added"
        );
        if (add) {
            increaseDeployAmount(integration, poolID, token, amount, 0);
        } else {
            decreaseDeployAmount(integration, poolID, token, amount, 0);
        }
    }

    /**
     *
     *
     * getters
     *
     *
     **/

    function getStrategy(uint256 id) public view override returns (StrategySummary memory) {
        StrategySummary memory result;
        result.name = strategies[id].name;
        result.integrations = strategies[id].integrations;
        result.tokens = strategies[id].tokens;
        return result;
    }

    function getMultipleStrategies(uint256[] calldata strategyTokens)
        external
        view
        override
        returns (StrategySummary[] memory)
    {
        StrategySummary[] memory severalStrategies = new StrategySummary[](strategyTokens.length);
        for (uint256 i; i < strategyTokens.length; i++) {
            severalStrategies[i] = getStrategy(strategyTokens[i]);
        }
        return severalStrategies;
    }

    function getStrategyTokenBalance(uint256 strategyId, address token) public view override returns (uint256) {
        return strategyTokenBalances[strategyId][token];
    }

    function getStrategyTokenLength(uint256 strategyId) external view override returns (uint256) {
        Token[] storage tokens = strategies[strategyId].tokens;
        return tokens.length;
    }

    function getTokenTotalBalance(address token, uint256[] calldata strategyIds)
        public
        view
        override
        returns (uint256 amount)
    {
        for (uint256 i; i < strategyIds.length; i++) {
            amount += strategyTokenBalances[strategyIds[i]][token];
        }
    }

    function getDeployAmount(
        address _integration,
        uint32 _poolId,
        address _token
    ) public view override returns (int256 deployAmount_, uint256 hedgeAmount_) {
        deployAmount_ = deployAmount[_integration][_poolId][_token].deploy;
        hedgeAmount_ = deployAmount[_integration][_poolId][_token].hedge;
    }

    function getMaximumCap(uint256 strategyId, address token) external view override returns (uint256 cap) {
        cap = strategies[strategyId].maximumCap[token];
    }

    /**
     *
     *
     * help methods
     *
     *
     **/

    function increaseDeployAmount(
        address _integration,
        uint32 _poolId,
        address _token,
        uint256 _deployAmount,
        uint256 _hedgeAmount
    ) private {
        deployAmount[_integration][_poolId][_token].deploy += int128(uint128(_deployAmount));
        deployAmount[_integration][_poolId][_token].hedge += uint128(_hedgeAmount);
    }

    function decreaseDeployAmount(
        address _integration,
        uint32 _poolId,
        address _token,
        uint256 _deployAmount,
        uint256 _hedgeAmount
    ) private {
        deployAmount[_integration][_poolId][_token].deploy -= int128(uint128(_deployAmount));
        deployAmount[_integration][_poolId][_token].hedge -= uint128(_hedgeAmount);
    }

    function increaseDeployAmount(
        address _integration,
        uint32 _poolId,
        address _token,
        int256 _deployAmount,
        uint256 _hedgeAmount
    ) private {
        if (_deployAmount > 0) {
            increaseDeployAmount(_integration, _poolId, _token, uint256(_deployAmount), _hedgeAmount);
        } else {
            decreaseDeployAmount(_integration, _poolId, _token, uint256(-_deployAmount), _hedgeAmount);
        }
    }

    function decreaseDeployAmount(
        address _integration,
        uint32 _poolId,
        address _token,
        int256 _deployAmount,
        uint256 _hedgeAmount
    ) private {
        if (_deployAmount > 0) {
            decreaseDeployAmount(_integration, _poolId, _token, uint256(_deployAmount), _hedgeAmount);
        } else {
            increaseDeployAmount(_integration, _poolId, _token, uint256(-_deployAmount), _hedgeAmount);
        }
    }

    function _verifyAndSetStrategy(
        uint256 strategyId,
        string memory name,
        Integration[] memory integrations,
        Token[] memory tokens,
        uint256[] memory maxCap
    ) internal {
        for (uint256 i; i < integrations.length; ++i) {
            require(integrations[i].integration != address(0), "bad integration");
        }

        address[] memory uniqueTokens = new address[](tokens.length);
        uint256 idx;
        for (uint256 i; i < tokens.length; ++i) {
            require(tokens[i].integrationPairIdx < integrations.length, "integration idx out of bounds");
            require(tokens[i].token != address(0), "bad token");

            if (tokenWeights[tokens[i].token] == 0) {
                uniqueTokens[idx] = tokens[i].token;
                idx++;
            }
            tokenWeights[tokens[i].token] += tokens[i].weight;
            strategies[strategyId].maximumCap[tokens[i].token] = maxCap[i];
        }

        // Verify weights
        for (uint256 i; i < idx; ++i) {
            require(tokenWeights[uniqueTokens[i]] == TOKEN_WEIGHT, "invalid token weight");
            strategies[strategyId].availableTokens[uniqueTokens[i]] = true;
            delete tokenWeights[uniqueTokens[i]];
        }

        strategies[strategyId].name = name;

        // Can't copy a memory array directly to storage yet, so we build it manually.
        for (uint256 i; i < integrations.length; i++) {
            strategies[strategyId].integrations.push(integrations[i]);
        }
        for (uint256 i; i < tokens.length; i++) {
            strategies[strategyId].tokens.push(tokens[i]);
        }
    }

    function migrateDeployAmounts(
        address _integration,
        address _token,
        uint32[] calldata _poolIds
    ) external onlyOwner {
        for (uint256 i; i < _poolIds.length; i++) {
            int256 old = deployAmount_DEPRECATED[_integration][_poolIds[i]][_token];

            increaseDeployAmount(_integration, _poolIds[i], _token, old, 0);

            delete deployAmount_DEPRECATED[_integration][_poolIds[i]][_token];
        }
    }
}
